					$affectedRows += $this->aPais->save($con);
				}
				$this->setPais($this->aPais);
			}

			if ($this->aTipoDistribuidor !== null) {
				if ($this->aTipoDistribuidor->isModified() || $this->aTipoDistribuidor->isNew()) {
					$affectedRows += $this->aTipoDistribuidor->save($con);
				}
				$this->setTipoDistribuidor($this->aTipoDistribuidor);
			}

			if ($this->aStand !== null) {
				if ($this->aStand->isModified() || $this->aStand->isNew()) {
					$affectedRows += $this->aStand->save($con);
				}
				$this->setStand($this->aStand);
			}

