			}
			if ($this->collStatuss) {
				foreach ($this->collStatuss as $o) {
					$o->clearAllReferences($deep);
				}
			}
		} // if ($deep)

		if ($this->collPagoExpositors instanceof PropelCollection) {
			$this->collPagoExpositors->clearIterator();
		}
		$this->collPagoExpositors = null;
		if ($this->collStatuss instanceof PropelCollection) {
			$this->collStatuss->clearIterator();
		}
		$this->collStatuss = null;
		$this->aFeria = null;
		$this->aExpositor = null;
		$this->aPais = null;
		$this->aTipoDistribuidor = null;
		$this->aStand = null;
		$this->aUsuario = null;
	}

	/**
	 * Return the string representation of this object
	 *
	 * @return string
	 */
	public function __toString()
	{
		return (string) $this->exportTo(ExpositorFeriaPeer::DEFAULT_STRING_FORMAT);
	}

	/**
	 * Catches calls to virtual methods
	 */
	public function __call($name, $params)
	{
		// symfony_behaviors behavior
		if ($callable = sfMixer::getCallable('BaseExpositorFeria:' . $name))
		{
		  array_unshift($params, $this);
		  return call_user_func_array($callable, $params);
		}

		if (preg_match('/get(\w+)/', $name, $matches)) {
			$virtualColumn = $matches[1];
			if ($this->hasVirtualColumn($virtualColumn)) {
				return $this->getVirtualColumn($virtualColumn);
			}
			// no lcfirst in php<5.3...
			$virtualColumn[0] = strtolower($virtualColumn[0]);
			if ($this->hasVirtualColumn($virtualColumn)) {
				return $this->getVirtualColumn($virtualColumn);
			}
		}
		return parent::__call($name, $params);
	}

